  \"2015-07-08T19:21:49.247459\",\n\t\"name\": \"sediment-analysis-network-for-decision-support-sands-landsat-geological-survey-of-al-gsa-a\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Geological Survey of Alabama (GSA) analyzed
  changes in the coastal shoreline and sedimentation using Landsat geotiff images
  as part of the Sediment Analysis Network for Decision Support (SANDS) project.  The
  daytime geotiffs images from Landsat 5 and Landsat 7 were analyzed for sediment
  re-distribution after a hurricane over the Gulf of Mexico coastline in Alabama and
  part of the Florida area having coordinates 31 to 27 North latitude and 90 to 84.25
  West longitude.  These are seasonal data for storms from 2001-2008.  In addition
  to the analyzed files, the data files include the ESRI files for zipped bands and
  grids, metadata, and storm temporal information for the sediment analysis images.\",\n\t\"license_title\":
